var title_f10_10_10405="Radiographic views for acetabular fractures";
var content_f10_10_10405=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F69019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F69019&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 536px\">",
"   <div class=\"ttl\">",
"    Radiographic views for acetabular fractures",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 516px; height: 407px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    This image depicts the normal lines and relationships of the acetabulum on different radiographic views and schematic pictures.",
"    <br>",
"     (A) Anteroposterior (AP) radiograph of the pelvis. 1, Iliopectineal line; 2, ilioischial line; 3, teardrop; 4, acetabular roof; 5, anterior rim of the acetabulum; 6, posterior rim of the acetabulum. The iliopectineal line, the anterior rim, and teardrop are landmarks of the anterior column; the ilioischial line and posterior rim are landmarks of the posterior columns.",
"     <br>",
"      (B) Iliac oblique radiograph of the pelvis. 1, Posterior border of the innominate bone. 2, Anterior rim of the acetabulum, which is seen best on this view. The iliac wing is seen en face, and fracture lines extending into the iliac wing are often best seen on this view. The proper amount of rotation is indicated by the tip of the coccyx lying just above the center of the contralateral femoral head.",
"      <br>",
"       (C) Obturator oblique radiograph of the pelvis. 1, Iliopectineal line. 2, Posterior rim of the acetabulum. The obturator ring is seen en face, and posterior wall fractures are seen best on this view. The proper amount of rotation is indicated by the tip of the coccyx lying just above the center of the ipsilateral femoral head.",
"       <div class=\"footnotes\">",
"       </div>",
"       <div class=\"reference\">",
"        Reproduced with permission from: Moed BR, Reilly MC. Lower extremity: Acetabulum fractures. In: Rockwood and Green's Fractures in Adults, 7th ed, Bucholz RW, Court-Brown CM, Heckman JD, Tornetta P (Eds), Lippincott Williams &amp; Wilkins, Philadelphia 2010. Copyright &copy; 2010 Lippincott Williams &amp; Wilkins.",
"       </div>",
"       <div class=\"contractual\">",
"        <br/>",
"        <a href=\"file://www.lww.com\">",
"         file://www.lww.com",
"        </a>",
"       </div>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
