var title_f10_10_10411="Nonasphyxial events and CP";
var content_f10_10_10411=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=OBGYN%2F67282&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=OBGYN%2F67282&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=8\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Criteria that suggest an intrapartum timing of an event that may be related to the development of cerebral palsy but is not specifically asphyxial",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td>",
"        A sentinel hypoxic event occurring immediately before or during labor",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        A sudden and sustained fetal bradycardia or absence of fetal heart rate variability in the presence of persistent late or variable decelerations. This usually occurs after a hypoxic sentinel event with a normal fetal heart rate pattern prior to the event.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Apgar score of 0 to 3 after five minutes",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Onset of multisystem involvement within 72 hours of birth",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Early imaging studies showing evidence of an acute nonfocal cerebral abnormality",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Adapted from: Task force on neonatal encephalopathy and cerebral palsy, American College of Obstetricians and Gynecologists (ACOG). Neonatal Encephalopathy and Cerebral Palsy: Executive Summary. Obstet Gynecol 2004; 103:780.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
